import React,{useState} from "react";
import './Picture.css'; 

const Picture = () =>{
    return(
        <div className="io">
            <div className="in">
                <img src="./sample.jpg" alt="Sample image" className="display"/>
                <div>
                    <input type="file"/>
                    <button className="picButton"></button>
                </div>


            </div>

            <div className="result">
                Result
            </div>
        </div>
    ); 
}

export default Picture;
